  <style>
        body {
            margin: 0;
            background-color: black;
            color: white;
            font-family: 'Poppins', sans-serif;
        }
        .poster-icon {
          overflow: visible;
          display: inline-block;
          transform: translateZ(0);
        }
        .poster-icon path {
          fill: #007bff !important;
          animation: pulse-fill 1.5s infinite;
          transform-origin: center;
        }
        @keyframes pulse-fill {
          0% { fill: #007bff; transform: scale(1); }
          50% { fill: #66b2ff; transform: scale(1.3); }
          100% { fill: #007bff; transform: scale(1); }
        }
        .media-control[data-media-control] .media-control-layer[data-controls] 
        .bar-container[data-seekbar] .bar-background[data-seekbar] {
            height: 3px !important;
        }
        .media-control[data-media-control] .media-control-layer[data-controls] 
        .bar-container[data-seekbar]:hover .bar-background[data-seekbar] {
            height: 5px !important;
        }
        #histats-container {
            display: none;
        }
        #loading {
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100vh;
            text-align: center;
        }
        .loading-balls {
            display: flex;
            gap: 10px;
            margin-bottom: 15px;
        }
        .ball {
            width: 15px;
            height: 15px;
            background: #007bff;
            border-radius: 50%;
            animation: bounce 0.6s infinite alternate;
        }
        .ball:nth-child(2) { animation-delay: 0.2s; }
        .ball:nth-child(3) { animation-delay: 0.4s; }
        @keyframes bounce {
            from { transform: translateY(0); }
            to { transform: translateY(-15px); }
        }
        #loading-text {
            font-size: clamp(1.2rem, 4vw, 2rem);
            font-weight: 600;
            color: white;
        }
        #player {
            flex: 1;
            width: 100%;
            height: 100vh;
            display: none;
        }
  </style>
</head>
<body>
  <div id="loading">
    <div class="loading-balls">
      <div class="ball"></div>
      <div class="ball"></div>
      <div class="ball"></div>
    </div>
    <div id="loading-text">Carregando player</div>
  </div>
  <div id="player"></div>
